  false,\n\t\"url\": null,\n\t\"notes\": \"Patrons may place holds on desired materials
  either online or by contacting any CPL location. The Chicago Public Library consists
  of the Harold Washington Library Center, Sulzer and Woodson regional libraries and
  over 75 neighborhood branches. Albany Park Branch closed 9/22/2012 for construction
  of a new branch expected to open in Fall 2014. Interim services had been provided
  in the Albany Park community. Many locations experience sporadic emergency closures
  due to heating or air conditioning issues, or area power outages.\",\n\t\"license_title\":
